"use strict";Bridge.define("ClientTestLibrary.Linq.TestLinqQueryExecution",{statics:{test:function(n){var e,u,r;n.expect(6);var t=[5,4,1,3,9,8,6,7,2,0],i=0,f=Bridge.Linq.Enumerable.from(t).select(function(){return++i});n.equal(i,0,"Query is not executed until you enumerate over them");f.toList(Bridge.Int);n.equal(i,10,"Query is  executed after you enumerate over them");i=0;e=Bridge.Linq.Enumerable.from(t).select(function(){return++i}).max();n.equal(i,10,"Max() executes immediately");u=Bridge.Linq.Enumerable.from(t).where(function(n){return n<=3});r=u.where(function(n){return n%2==0});n.deepEqual(r.toArray(),[2,0],"Query in a query");Bridge.Linq.Enumerable.from(t).forEach(function(n,i){return t[i]=-t[i]});n.deepEqual(Bridge.Linq.Enumerable.from(t).toArray(),[-5,-4,-1,-3,-9,-8,-6,-7,-2,0],"ForEach()");n.deepEqual(r.toArray(),[-4,-8,-6,-2,0],"Second query run on a modified source")}}});Bridge.init();